import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css'; // Be sure to include the styles

function ImageSlider() {
  return (
    <Carousel>
      <div>
        <img src="pexels-gustavo-fring-3985062" alt="Image 1" />
      </div>
      <div>
        <img src="pexels-gustavo-fring-3985062" alt="Image 2" />
      </div>
      <div>
        <img src="image3.jpg" alt="Image 3" />
      </div>
    </Carousel>
  );
}

export default ImageSlider;
